import React from "react";
import "../css/PrivacyPolicy.css";

const PrivacyPolicy = () => {
  return (
    <div className="privacy-policy">
      <h2>Privacy Policy</h2>
      <p>
        Plan Bee Estate Private Limited Of companies (that is, our subsidiaries,
        our ultimate holding company, and its subsidiaries) (“we”, “our”, “us”)
        are committed to protecting and respecting your privacy. This privacy
        policy (together with our terms of use and any other documents referred
        to on it) sets out the basis on which any personal data we collect from
        you, or that you provide to us, will be processed by us. Please read the
        following carefully to understand our views and practices regarding your
        personal data and how we will treat it. By visiting
        https://planbeeestate.com/ to which this privacy policy applies
        (“Sites”) or otherwise providing us with information you are accepting
        and consenting to the practices described in this policy.
      </p>
      {/* Include the rest of the Privacy Policy content here */}
      <h3>Information We May Collect From You</h3>
      <p>
        i) Information you give us. You may give us information about you by
        filling in forms on our sites, or by submitting your CV, or by
        corresponding with us by phone, e-mail or otherwise, or by interacting
        with any of our business partners...
      </p>
      {/* Continue with the rest of the Privacy Policy text */}
    </div>
  );
};

export default PrivacyPolicy;
